var cordovaDeviceModule=angular.module("cordovaDeviceModule",[]);cordovaDeviceModule.constant("cordovaDeviceConstants",{apiVersion:"1.0.0"});cordovaDeviceModule.factory("cordovaDeviceService",["$log","cordovaDeviceConstants",function(e,t){return{apiVersion:function(){e.debug("cordovaDeviceService.apiVersion.");return t.apiVersion},cordova:function(){e.debug("cordovaDeviceService.cordova.");return this.getDeviceValue("cordova")},platform:function(){e.debug("cordovaDeviceService.platform.");return this.getDeviceValue("platform")},uuid:function(){e.debug("cordovaDeviceService.uuid.");return this.getDeviceValue("uuid")},version:function(){e.debug("cordovaDeviceService.version.");return this.getDeviceValue("version")},model:function(){e.debug("cordovaDeviceService.model.");return this.getDeviceValue("model")},getDeviceValue:function(t){e.debug("cordovaDeviceService.value.");if(!window.device){e.warn("Device API is not available.");return null}return window.device[t]}}}]);cordovaDeviceModule.controller("CordovaDeviceCtrl",["$scope","cordovaDeviceService",function(e,t){e.deviceService=t}])